import Sidebar from './components/navbar/sidebar';
import './App.css';
import { BrowserRouter,Routes,Route } from "react-router-dom";
import Academic from './components/academic/Academic.js'


function App() {
  return (
    <>
    <Sidebar/>
    <BrowserRouter>
    <ul type='none'>
                    <li className="space1"><Link to="/" className="space1">Home</Link></li>
                    <li className="space"><Link to="/About">About</Link></li>
                    <li className="space"><Link to="/Academic">Academic Projects</Link></li>
                    <li className="space"><Link to="/">Specialized In</Link></li>
                    <li className="space"><Link to="/">Contact Us</Link></li>
                </ul>  
        <Routes>
          <Route path="/" />
          <Route path="/About" element={<Academic />} />
        </Routes>
    </BrowserRouter>
    </>
  );
}

export default App;
